import axios from 'axios'
import AuthenticationService from "./AuthenticationService";

const LOCALHOST = 'http://localhost:8080'


class MainPageService {
    getAllProjects() {
        return axios({
            method: 'get',
            url: `${LOCALHOST}/projects/all`
        });
    }

}

export default new MainPageService();
